import React, { Component } from 'react';

// Define the class component
class MyComponent extends Component {
  // Constructor to initialize state (optional)
  constructor(props) {
    super(props);
    this.state = {
      message: 'Hello, World!', // Initial state
    };
  }

  // Render method to display UI
  render() {
    return (
      <div>
        <h1>{this.state.message}</h1>
        <button onClick={() => this.setState({ message: 'Hello, React!' })}>
          Change Message
        </button>
      </div>
    );
  }
}

export default MyComponent;
